import './App.css';
import Header from './components/Header';
import Body from './components/Body';
import LoadingPage from './components/LoadingPage';
import { useAuth0 } from '@auth0/auth0-react';

function App() {
  const { user, isAuthenticated, isLoading } = useAuth0();
  return (
    <>
      <Header />
      {isLoading ? (
        <LoadingPage
          isLoading={isLoading}
        />
      ) : (
        <Body />
      )}
    </>
  );
}

export default App;
